CREATE TABLE Departments (
    DepartmentID INT PRIMARY KEY,
    DepartmentName VARCHAR(100),
    Location VARCHAR(100),
    ManagerID INT,
    Budget DECIMAL(15, 2),
    PhoneNumber VARCHAR(20),
    Email VARCHAR(100),
    EstablishedDate DATE,
    NumberOfEmployees INT,
    ParentDepartmentID INT,
    FOREIGN KEY (ParentDepartmentID) REFERENCES Departments(DepartmentID)
);

CREATE TABLE Engineers (
    EngineerID INT PRIMARY KEY,
    FirstName VARCHAR(50),
    LastName VARCHAR(50),
    MiddleName VARCHAR(50),
    BirthDate DATE,
    HireDate DATE,
    Position VARCHAR(100),
    DepartmentID INT,
    Email VARCHAR(100),
    PhoneNumber VARCHAR(20),
    FOREIGN KEY (DepartmentID) REFERENCES Departments(DepartmentID)
);

CREATE TABLE Clients (
    ClientID INT PRIMARY KEY,
    ClientName VARCHAR(100),
    ContactName VARCHAR(100),
    ContactEmail VARCHAR(100),
    ContactPhone VARCHAR(20),
    Address VARCHAR(200),
    City VARCHAR(100),
    Country VARCHAR(100),
    PostalCode VARCHAR(20),
    Industry VARCHAR(100),
    Website VARCHAR(100)
);

CREATE TABLE Projects (
    ProjectID INT PRIMARY KEY,
    ProjectName VARCHAR(100),
    StartDate DATE,
    EndDate DATE,
    Budget DECIMAL(15, 2),
    DepartmentID INT,
    ProjectManagerID INT,
    Status VARCHAR(50),
    ClientID INT,
    Description TEXT,
    FOREIGN KEY (DepartmentID) REFERENCES Departments(DepartmentID),
    FOREIGN KEY (ClientID) REFERENCES Clients(ClientID)
);

CREATE TABLE Tasks (
    TaskID INT PRIMARY KEY,
    TaskName VARCHAR(100),
    ProjectID INT,
    AssignedTo INT,
    StartDate DATE,
    DueDate DATE,
    Status VARCHAR(50),
    Priority VARCHAR(50),
    Description TEXT,
    CompletionDate DATE,
    FOREIGN KEY (ProjectID) REFERENCES Projects(ProjectID)
);

CREATE TABLE Suppliers (
    SupplierID INT PRIMARY KEY,
    SupplierName VARCHAR(100),
    ContactName VARCHAR(100),
    ContactEmail VARCHAR(100),
    ContactPhone VARCHAR(20),
    Address VARCHAR(200),
    City VARCHAR(100),
    Country VARCHAR(100),
    PostalCode VARCHAR(20),
    Website VARCHAR(100)
);

CREATE TABLE Materials (
    MaterialID INT PRIMARY KEY,
    MaterialName VARCHAR(100),
    SupplierID INT,
    UnitPrice DECIMAL(10, 2),
    QuantityInStock INT,
    ReorderLevel INT,
    UnitOfMeasure VARCHAR(50),
    Category VARCHAR(100),
    Description TEXT,
    LastOrderDate DATE,
    FOREIGN KEY (SupplierID) REFERENCES Suppliers(SupplierID)
);

CREATE TABLE Equipment (
    EquipmentID INT PRIMARY KEY,
    EquipmentName VARCHAR(100),
    Manufacturer VARCHAR(100),
    ModelNumber VARCHAR(100),
    PurchaseDate DATE,
    WarrantyExpiryDate DATE,
    DepartmentID INT,
    Location VARCHAR(100),
    Status VARCHAR(50),
    MaintenanceSchedule TEXT,
    FOREIGN KEY (DepartmentID) REFERENCES Departments(DepartmentID)
);

CREATE TABLE MaintenanceRecords (
    MaintenanceID INT PRIMARY KEY,
    EquipmentID INT,
    MaintenanceDate DATE,
    EngineerID INT,
    Description TEXT,
    Cost DECIMAL(10, 2),
    NextScheduledDate DATE,
    Status VARCHAR(50),
    MaintenanceType VARCHAR(100),
    SupplierID INT,
    FOREIGN KEY (EngineerID) REFERENCES Engineers(EngineerID),
    FOREIGN KEY (SupplierID) REFERENCES Suppliers(SupplierID),
    FOREIGN KEY (EquipmentID) REFERENCES Equipment(EquipmentID)
);

CREATE TABLE Certifications (
    CertificationID INT PRIMARY KEY,
    CertificationName VARCHAR(100),
    IssuingOrganization VARCHAR(100),
    IssueDate DATE,
    ExpiryDate DATE,
    EngineerID INT,
    CertificationLevel VARCHAR(50),
    Description TEXT,
    RenewalRequirements TEXT,
    Status VARCHAR(50),
    CertificationNumber VARCHAR(50),
    FOREIGN KEY (EngineerID) REFERENCES Engineers(EngineerID)
);

CREATE TABLE TrainingPrograms (
    TrainingID INT PRIMARY KEY,
    ProgramName VARCHAR(100),
    Provider VARCHAR(100),
    StartDate DATE,
    EndDate DATE,
    Cost DECIMAL(10, 2),
    Location VARCHAR(100),
    Description TEXT,
    EngineerID INT,
    Status VARCHAR(50),
    CertificationID INT,
    FOREIGN KEY (EngineerID) REFERENCES Engineers(EngineerID),
    FOREIGN KEY (CertificationID) REFERENCES Certifications(CertificationID)
);

CREATE TABLE SafetyIncidents (
    IncidentID INT PRIMARY KEY,
    DateOfIncident DATE,
    EngineerID INT,
    Description TEXT,
    Location VARCHAR(100),
    SeverityLevel VARCHAR(50),
    ReportedBy INT,
    CorrectiveActions TEXT,
    Status VARCHAR(50),
    EquipmentID INT,
    FOREIGN KEY (EngineerID) REFERENCES Engineers(EngineerID),
    FOREIGN KEY (EquipmentID) REFERENCES Equipment(EquipmentID)
);

CREATE TABLE DesignDocuments (
    DocumentID INT PRIMARY KEY,
    DocumentName VARCHAR(100),
    ProjectID INT,
    AuthorID INT,
    CreationDate DATE,
    LastModifiedDate DATE,
    Version VARCHAR(50),
    Status VARCHAR(50),
    FilePath VARCHAR(200),
    Description TEXT,
    FOREIGN KEY (ProjectID) REFERENCES Projects(ProjectID)
);

CREATE TABLE QualityAssurance (
    QAID INT PRIMARY KEY,
    ProjectID INT,
    EngineerID INT,
    DateOfInspection DATE,
    Findings TEXT,
    Recommendations TEXT,
    Status VARCHAR(50),
    FollowUpDate DATE,
    QAType VARCHAR(100),
    DocumentID INT,
    FOREIGN KEY (EngineerID) REFERENCES Engineers(EngineerID),
    FOREIGN KEY (ProjectID) REFERENCES Projects(ProjectID),
    FOREIGN KEY (DocumentID) REFERENCES DesignDocuments(DocumentID)
);

CREATE TABLE Budgets (
    BudgetID INT PRIMARY KEY,
    ProjectID INT,
    DepartmentID INT,
    FiscalYear INT,
    TotalBudget DECIMAL(15, 2),
    SpentAmount DECIMAL(15, 2),
    RemainingAmount DECIMAL(15, 2),
    Status VARCHAR(50),
    LastUpdated DATE,
    ApprovedBy INT,
    FOREIGN KEY (DepartmentID) REFERENCES Departments(DepartmentID),
    FOREIGN KEY (ProjectID) REFERENCES Projects(ProjectID)
);






























